import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMoon, faSun } from "@fortawesome/free-solid-svg-icons";

const Logo = () => (
  <div className="not-fancy-font flex flex-col ml-5 mt-8 w-full absolute right-0">
    <div className="flex items-center ">
      <div className="text-white text-50 font-light tracking-12">NEEK</div>
      <div className="flex gap-5">
        <FontAwesomeIcon icon={faMoon} className="text-white text-x-large" />
        <FontAwesomeIcon icon={faSun} className="text-white text-x-large" />
      </div>
    </div>
    <div className="flex gap-3">
      <div className="bg-white h-2 w-115 border-white mt-2" />
      <div className="text-white text-16">Software Engineer/ Artist</div>
    </div>
  </div>
);

export default Logo;
